import React from 'react';
import FormA from './form'
import '../App.css';

class Main extends React.Component {

    constructor(props){
        super(props),

        this.state = {

            name :'',
            cost :'',
            weight: '',

            objectList: []
        }
    }

    render(){
          return (
        <div classNames=''>
            <p>Bags of shouuut...</p>
            <p>This is Main</p>
            <FormA key={this.objectList }name={this.state.name} cost={this.state.cost} weight={this.state.weight} objectList={this.state.objectList} />
        </div>
    )  
    }

}

export default Main
